import './App.css';
import Navbar from './components/Navbar.js'

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/about" element={<AboutUs />} />
                <Route path="/contact" element={<ContactUs />} />
            </Routes>
    </div>
  );
}

export default App;
